export default function Onama(){
   return(
      <div className="Onama">
         <h1>O NAMA</h1>
         <img src="slike/a.png" alt="logo"/>
         <div className="kutijaZaKutije">
            <div>
               <p>
               // Prirodni kamen DN je osnovan 2014. godine kako bi klijentima pruzio najbolju uslugu ugradnje brajkovackog pescara i druge vrste dekorativnog kamena. 
               Nas rad odlikuju preciznost, postovanje dogovorenih rokova, a pre svega zelja da svakom klijentu ispunimo zeljena ocekivanja.
               </p>
            </div>
         </div>
      </div>
   )
}
